🇧🇷🧐🇧🇷🧐
Nesta semana, o presidente Jair Bolsonaro assinou a renovação da concessão do canal 11 do Rio de Janeiro, emissora de Silvio Santos. Foi a primeira concessão dada pelo governo federal ao empresário em 1975, a TVS do Rio de Janeiro.

@GeFazioBreakingNews🇧🇷

Normalmente ignoramos essas perguntas, mas como vem se intensificando...

1. As FA estão unidas, o presidente já disse isso várias vezes;

2. O Presidente não será impedido de governar por causa de uma Intervenção Militar: ele já está impedido de governar, faz 4 anos;

3. As denúncias de que existem generais comunistas são infundadas, oriundas da direita canhota.  Nunca apresentaram provas. Se vocês continuarem seguindo esta pseudo direita, não terão êxito.  Não servem 8 anos de fracasso? Querem mais 8?

AVISO AOS COMPONENTES DO MOVIMENTO ANTI-NOVO NORMAL

São proibidas postagens com:

- Criticas às manifestações nos quartéis;
- Críticas ao presidente e sua família;
- Criticas às FFAA;
- Incentivo à violência ou atos violentos.
- Manobras e interpretações jurídicas sobre o art 142 que seja contra o nosso objetivo principal que é a Intervenção Militar e o Presidente Bolsonaro no poder.

Estas postagens serão automaticamente apagadas e seus autores expulsos.

SE VOCÊ NÃO IDENTIFICAR QUEM SÃO OS INIMIGOS A SEREM COMBATIDOS, VOCÊ SERÁ ABATIDO POR ELES.

⚠️ ATENÇÃO ⚠️

Este é o artigo 84 da Constituição Federal, os incisos aqui destacados não abrem a possibilidade de “revisão” pelo Supremo Tribunal Federal, nem estão sob dependência de nenhum outro Poder para sua legitima utilização.

Art. 84. Compete privativamente ao Presidente da República:
I - nomear e exonerar os Ministros de Estado;
II - exercer, com o auxílio dos Ministros de Estado, a direção superior da administração federal;
IV - sancionar, promulgar e fazer publicar as leis, bem como expedir decretos e regulamentos para sua fiel execução;
VII - manter relações com Estados estrangeiros e acreditar seus representantes diplomáticos;
IX - decretar o estado de defesa e o estado de sítio;
X - decretar e executar a intervenção federal;
XII - conceder indulto e comutar penas, com audiência, se necessário, dos órgãos instituídos em lei;
XIII - exercer o comando supremo das Forças Armadas, nomear os Comandantes da Marinha, do Exército e da Aeronáutica, promover seus oficiais-generais e nomeá-los para os cargos que lhes são privativos; (Redação dada pela Emenda Constitucional nº 23, de 02/09/99)
XVII - nomear membros do Conselho da República, nos termos do art. 89, VII;
XVIII - convocar e presidir o Conselho da República e o Conselho de Defesa Nacional;

